import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class TodoContent extends Component {
    render() {
        return (
            <div className='TDParent'>
                <h1>나의 할일들</h1>
                <button className='button'>추가</button>
                <TodoContent/>
            </div>
        )
    }
}
